import styles from "../css/Home.module.css"
import Card from '../components/Card';

const Home = () => {
  const totalCard = [
    {id:1,
    title: "lorem ipsum"},
    {id:2,},
    {id:3,},
    {id:4,},
    {id:5,},
    {id:6,},
    {id:7,},
    {id:8,},
    {id:9,},
  ]
  return (
    <div className={styles.cardSection}>
      {totalCard.map((it, idx) => {
        return <Card id={it.id}/>
      })}
    </div>
  )
}

export default Home
